import Router from 'next/router'
import ReactMarkdown from 'react-markdown'

const Cameras = ({ cameras }) => {
  return (
    <div onClick={() => Router.push('/p/[id]', `/p/${cameras.id}`)}>
      <h4>Nome: {cameras.cameraname}</h4>
      <h4>Número de série:  {cameras.serialnumber} </h4>
      <h4>Fabricante:  {cameras.manufacturer} </h4>
      <style jsx>{`
        div {
          color: inherit;
          padding: 3rem;
        }
      `}</style>
    </div>
  )
}

export default Cameras
